import { Box, withStyles } from "@material-ui/core";
import useQuizInfo from "./useQuizInfo";

interface IProps {
  quizId: number;
}

export default function QuizInfo({ quizId }: IProps) {
  useQuizInfo(quizId);
  return <Container></Container>
}

const Container = withStyles({
  root: {
    padding: "1rem",
  },
})(Box);
